constructor() {
priceFeed = AggregatorV3Interface(address(0x9326BFA02ADD2366b30bacB125260Af641031331));
}

function getThePrice() public view returns (int) {
(
    , 
    int price,
    ,
    ,

) = priceFeed.latestRoundData();
